import React from "react";
import Navigation from "./navigation";
import ImageLink from "./imageLink";
import Footer from "./footer";
import * as faceapi from 'face-api.js';

function App() {
  const imgRef = React.useRef();
  const canvasRef = React.useRef();
  const [faces, setFaces] = React.useState([])

  const handleImage = async () => {
    const detections = await faceapi.detectAllFaces(imgRef.current, new faceapi.TinyFaceDetectorOptions())
    .withFaceLandmarks().withFaceExpressions();
    console.log(imgRef.current);
    console.log(detections);
  };

  React.useEffect(() => {
    const loadModels = () => {
      Promise.all([
        faceapi.nets.tinyFaceDetector.loadFromUri("./models"),
        faceapi.nets.faceLandmark68Net.loadFromUri("/models"),
        faceapi.nets.faceExpressionNet.loadFromUri("/models"),
      ])
        .then(console.log(handleImage))
        .catch((e) => console.log(e));
    };

    imgRef.current && loadModels();
  }, []);

  function imgLink(link){
   console.log(link);
  }
  return (
    <div className="App">
      <Navigation />
      <ImageLink fetchImg={imgLink}/>
      <img ref={imgRef} 
      crossOrigin="anonymous"
      src="data:image/jpeg;base64," 
      alt="image" 
      style={{width: '500px', height: '500px'}}
      />
      <canvas ref={canvasRef} style={{width: '500px', height: '500px'}}></canvas>
      <Footer />
      </div>
  );
}

export default App;
